const Pagination = ({ todosPerPage, todos, paginate, activePageNr }) => {
  const pageNumbers = [];


  for (let i = 1; i <= Math.ceil(todos / todosPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <div  className='pagination'>
        {pageNumbers.map(number => (
            <li key ={number} className='page-item'>
            <a onClick={() => paginate(number)} href='!#' className={`${number ? 'Active' : ''}`}>
              {number}
            </a>
            </li>
        ))}
    </div>
  );

};

export default Pagination;
